content.css:
/* Custom CSS classes for Power BI visual */
.flex {
  display: flex;
}
.justify-between {
  justify-content: space-between;
}
.px-6 {
  padding-left: 1.5rem;
  padding-right: 1.5rem;
}
.py-6 {
  padding-top: 1.5rem;
  padding-bottom: 1.5rem;
}
.items-center {
  align-items: center;
}
.rounded-3xl {
  border-radius: 1.5rem;
}
.bg-primary {
  background-color: #171717;
}
.border {
  border-width: 1px;
}
.border-secondary {
  border-color: #64748b;
}
.text-white {
  color: white;
}
.mb-6 {
  margin-bottom: 1.5rem;
}
.font-medium {
  font-weight: 500;
}
.text-40px {
  font-size: 2.5rem;
}
.react-container {
  width: 100%;
  height: 100%;
  padding: 1rem;
}
.react-visual-container {
  width: 100%;
  height: 100%;
}
.text-18px {
  font-size: 1.125rem;
}
.mb-4 {
  margin-bottom: 1rem;
}
.mb-3 {
  margin-bottom: 0.75rem;
}
.mb-2 {
  margin-bottom: 0.5rem;
}
.mt-4 {
  margin-top: 1rem;
}
.text-sm {
  font-size: 0.875rem;
}
.gap-4 {
  gap: 1rem;
}
.gap-2 {
  gap: 0.5rem;
}
.chart-container {
  width: 100%;
}
.chart-bar-container {
  width: 100%;
}
.chart-bar-wrapper {
  width: 100%;
  background-color: #2a2a2a;
  border-radius: 4px;
  overflow: hidden;
}
.chart-bar {
  min-width: 4px;
}
.chart-container {
  position: relative;
  width: 100%;
}
.rounded-xl {
  border-radius: 0.75rem;
}
.p-4 {
  padding: 1rem;
}
/* Ensure chart bars are visible */
.chart-bar-wrapper {
  width: 100%;
  background-color: #2a2a2a;
  border-radius: 4px;
  overflow: hidden;
  min-height: 24px;
  position: relative;
}
.chart-bar {
  min-width: 4px;
  height: 24px;
  border-radius: 4px;
  transition: width 0.3s ease;
  position: relative;
  z-index: 1;
}

/* Theme Colors - CSS Variables */
:root {
  /* Primary Colors */
  --color-primary: #171717;
  --color-primary-100: #000000;
  --color-primary-200: #000000;
  --color-secondary: #313131;
  --color-secondary-100: #cccccc;
  --color-secondary-300: #cccccc;
  --color-black: #0d0d0d;
  --color-success: #1f8e4d;
  --color-orange: #906c07;
  /* Buttons */
  --color-button-primary: #000000;
  --color-button-primary-hover: rgba(0, 0, 0, 0.4);
  --color-button-primary-foreground: #ffffff;
  --color-button-outline: #79123d;
  --color-button-outline-foreground: #ffffff;
}
/* Dark Mode */
.dark {
  --color-primary: #171717;
  /* Buttons */
  --color-button-primary: #79123d;
  --color-button-primary-hover: #79123d;
  --color-button-primary-foreground: #ffffff;
  --color-button-outline: #79123d;
  --color-button-outline-foreground: #ffffff;
  /* Neutral Colors */
  --color-white: #222124;
  --color-black: #ffffff;
}
/* Container utility */
.container {
  margin-inline: auto;
  padding-inline: 1rem;
  /* optional padding */
}
/* Breakpoints (similar to Tailwind screens) */
@media (min-width: 768px) {
  .container {
    max-width: 744px;
  }
}
@media (min-width: 1024px) {
  .container {
    max-width: 1000px;
  }
}
@media (min-width: 1280px) {
  .container {
    max-width: 1256px !important;
  }
}
@media (min-width: 1400px) {
  .container {
    max-width: 1376px !important;
  }
}
@media (min-width: 1536px) {
  .container {
    max-width: 1512px !important;
  }
}
/* Loader utilities */
.show-loader {
  display: block;
}
.hide-loader {
  display: none;
}
body:has(.show-loader) {
  overflow: hidden;
}
/* General styling */
body {
  background-color: var(--color-black);
}
section {
  margin-bottom: 24px;
}
